pragma solidity >=0.4.21 <0.7.0;

contract SimpleStorage {
  bytes storedDatas;
  string str;
  //file文件的结构体
  struct File {
    string fileName;
    string hashValue;
    uint size;
    address uploader;
    string transactionHash;
  }
  //file文件的结构体的数组
  File[] files;
  mapping (address => string) Username;
  mapping (address => File) Userfile;
  mapping (address => File[]) Userfiles; //键值对，值是数组
  mapping (address => mapping (bytes32 => File) ) UserfileName; //用户通过文件名字找到

  function set(bytes memory x) public {
    storedDatas = x;
  }
  function setStr(string memory x) public {
    str = x;
  }

  function setFile(string memory fileName,string memory hashValue,uint size,address uploader,string memory transactionHash) public {
    Userfile[uploader] = File(fileName,hashValue,size,uploader,transactionHash);
    Userfiles[uploader].push(File(fileName,hashValue,size,uploader,transactionHash));
  }

  function setName(address user,string memory name) public {
    Username[user] = name;
  }
  function getFile(address add) public view returns (uint,string memory,string memory,uint) {
    uint length = Userfiles[add].length;
    require(
          length > 0,
          "the user not file"
      );
    string memory fileName = Userfiles[add][length-1].fileName;
    string memory hashvalue2 = Userfiles[add][length-1].hashValue;
    uint size = Userfiles[add][length-1].size;
    return (length,fileName,hashvalue2,size);
  }

  function get() public view returns (bytes memory) {
    return storedDatas;
  }
  function getStr() public view returns (string memory) {
    return str;
  }
  function getName(address user) public view returns (string memory) {
    string memory name = Username[user];
    return name;
  }



}
